import React from "react";
import '../App.css';
import { Image } from '@chakra-ui/react'

function Nav() {
    return (
        <div className="navbar">
            <Image src="https://i.ibb.co/5TyTXRr/Logo.jpg" />
            <ul>
                <Link href="/Header.js">Home</Link>
                <Link></Link>
                <Link></Link>
                <Link></Link>
                <Link as={ReachLink} to='/home'>About</Link>
                <Link></Link>
            </ul>
        </div>
    );
}

export default Nav;
